// Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h2>Welcome to the User Management Dashboard</h2>
      <Link to="/see-all-users">See all Users</Link>
      <Link to="/update-users">Update Users</Link>
      <Link to="/delete-user">Delete A User</Link>
    </div>
  );
};

export default Dashboard;
